import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import NavegacaoTab from './app/navigation/NavegacaoTab';


export default function App() {
  return (
    <NavigationContainer>
      <NavegacaoTab />
    </NavigationContainer>
  );
}
